import React from 'react';
import "./card.css"

interface Props{
    name:string,
    imgsrc?:string,
    rating:number,
    synopsis?:string
}


export const Movie:React.FC<Props>=({name,imgsrc,rating,synopsis}) =>{
    return (
        <div className="card-container">
            <img src={imgsrc} alt="Movie Image"/>
            <div className="lower-content">
                <h1>{name}</h1>
                <p>{synopsis}</p>
            </div>          
        </div>
    );
}

export default Movie;
